import React, { useState } from 'react'
import './Navigation.css'
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import MenuIcon from '@material-ui/icons/Menu';
import { SwipeableDrawer } from '@material-ui/core';
import ArrowBackIosIcon from '@material-ui/icons/ArrowBackIos';

export default function Navigation() {


    const [OpenMenu, setOpenMenu] = useState()

    const sideNavMenu=()=>{
        setOpenMenu(true)
    }
    



    return (
        <div>
            <Grid className="Navigation-Parent"  justify="flex-start"  container  >
                <Button className="nav-button" variant="outlined" color="primary" item>  Home   </Button>
                <Button className="nav-button" variant="outlined" color="primary" item>  About   </Button>
                <Button className="nav-button" variant="outlined" color="primary" item>  Skills   </Button>
                <Button className="nav-button" variant="outlined" color="primary" item>  Projects   </Button>
                <Button className="nav-button" variant="outlined" color="primary" item>  Contact   </Button>

                <Button className="nav-menu" onClick={sideNavMenu} > <MenuIcon color="primary" /> </Button> 
            </Grid>

            <div>
                
                <SwipeableDrawer open="true" swipeAreaWidth="20" className="sideNavMenu bg-dark">

                <div className="sideMenuCloseIcon"> <Button> <ArrowBackIosIcon color="primary" fontSize="large" /> </Button>  </div>

                <div className=""> 
                <Button> Home </Button>
                <Button> About </Button>
                <Button> Skills </Button>
                <Button> Projects </Button>
                <Button> Contact </Button>


                </div>

                </SwipeableDrawer>

            </div>
        </div>
    )
}
